import { ClipboardModule } from '@angular/cdk/clipboard'
import { CommonModule, NgOptimizedImage } from '@angular/common'
import { AfterViewInit, Component } from '@angular/core'
import { FormsModule } from '@angular/forms'
import { RouterOutlet } from '@angular/router'
import VCardType3Model from './models/v-card-type3.model'
import {
  JsonContactReaderService
} from './services/json-contact-reader.service'

@Component({
  selector: 'app-root',
  standalone: true,
  imports: [
    CommonModule,
    RouterOutlet,
    FormsModule,
    NgOptimizedImage,
    ClipboardModule
  ],
  templateUrl: './app.component.html',
  styleUrl: './app.component.scss'
})
export class AppComponent implements AfterViewInit {
  textToBeEncoded: string = ''
  textToBeDecoded: string = ''
  encodedText: string = ''
  decodedText: string = ''
  googleApiUrlBase: string = 'https://chart.googleapis.com/chart?chs=250x250&cht=qr&chl='
  vcard: string[] = [
    'BEGIN:VCARD',
    'VERSION:3.0',
    'N:;A2Z Accounting;;;',
    'FN:A2Z Accounting',
    'ORG:ບໍລິສັດ ເອທູຊີ ບໍລິການບັນຊີ ຈໍາກັດ / A2Z Accounting Service Co., Ltd.',
    'EMAIL;TYPE=internet;X-CUSTOM(CHARSET=UTF-8,ENCODING=QUOTED-PRINTABLE,=45=6d=61=69=6c):info@a2zaccountinglao.com',
    'TEL;TYPE=WORK;X-CUSTOM(CHARSET=UTF-8,ENCODING=QUOTED-PRINTABLE,=4d=72=2e=20=44=6f=75=61=6e=67=74=61=20=43=68=61=6e=74=68=61=70=68=6f=6e=65):+8562078996697',
    'TEL;TYPE=WORK;X-CUSTOM(CHARSET=UTF-8,ENCODING=QUOTED-PRINTABLE,=4d=73=2e=20=56=69=6c=61=76=61=6e=68=20=42=6f=75=70=68=61):+8562057896354',
    'ADR;TYPE=WORK;type=pref:;; ;Thongsangnang Village, Chanthabouly District;Vientiane Capital;;Lao PDR',
    'URL:www.a2zaccountinglao.com',
    // 'PHOTO;TYPE=JPG;ENCODING=B:',
    // 'https://upload.wikimedia.org/wikipedia/commons/2/25/Intel_logo_%282006-2020%29.jpg',
    // 'PHOTO;TYPE=SVG;ENCODING=B:',
    'END:VCARD'
  ]
  vcardTestString: string = ''

  constructor(private jsonContactReaderService: JsonContactReaderService) {
  }

  ngAfterViewInit(): void {
    this.setVCardTest()
  }

  encodeToQuotedPrintable(text: string) {
    return [...text].map(c => '=' + c.charCodeAt(0).toString(16)).join('')
  }

  decodeFromQuotedPrintable(text: string) {
    return decodeURIComponent(text.replace(/={1}/g, '%'))
  }

  onEncoderInputChange(event: KeyboardEvent) {
    const txt: string = (event.target as HTMLInputElement)?.value
    this.encodedText = this.encodeToQuotedPrintable(txt)
  }

  onDecoderInputChange(event: KeyboardEvent) {
    const txt: string = (event.target as HTMLInputElement)?.value
    this.decodedText = this.decodeFromQuotedPrintable(txt)
  }

  getVcardQrCodeUrl(vcardInfo: string | string[]) {
    const vcardEncoded = Array.isArray(vcardInfo)
      ? vcardInfo.map((
          item: string,
          index: number
        ) => encodeURIComponent(item +
          (index < this.vcard.length - 2 ? '\n' : '')))
        .join('')
      : encodeURIComponent(vcardInfo)
    return this.googleApiUrlBase + vcardEncoded
  }

  setVCardTest() {
    this.jsonContactReaderService.getContactData(
      'assets/data/contact_data_a2z_company.json'
      // 'assets/data/contact_data_vilavanh_boupha_plan_international.json'
    ).subscribe({
      next: (r: VCardType3Model) => {
        console.log(
          'app.component.ts => subscribe => VCardType3Model.photoBase64 =>',
          `"${r?.photo?.photoBase64.substring(0, r?.photo?.photoBase64.indexOf(','))}"`
          // r?.photoBase64
        )
        this.vcardTestString = r.vCardString
      },
      error: error => {
        console.log('error', error)
      }
    })
  }

  getDecodedText() {
    // console.log('this.decodedText', this.decodedText)
    return this.decodedText
  }
}
